import React from 'react'
import ImgProfile from "./final.png";
import './Navbar.css';
function Navbar() {
  return (
    <div>
      <nav className="">
        <div className="logo"> <img className="brand" src={ImgProfile}  width="25%" alt ="LOGO"/></div>
        <ul className="nav-links">
          <li><a href="/">Home</a></li>
          <li><a href="/">DMCE</a></li>
          <li><a href="/">Contact us</a></li>
          <li><a href="/">About us</a></li>

        </ul>
      </nav>
    </div>
  )
}

export default Navbar
